window.bookSummaryJSON = "<p>Book Seven of the Demon Accords. Chris Gordon has never had an easy relationship with the White House. Now, after rescuing his goddaughter from a secret base in New Hampshire, it’s reached a new low. You drop one little asteroid onto the continental United States and the entire government goes crazy. On top of that Halloween is fast approaching and demons are popping through into our world every which way. Forced into the world of high-level politics, Chris and Tanya and their merry crew will have to stay two steps ahead of just about everyone if they’re going to have a chance in hell of preventing all Hell from breaking loose. </p>"; 
